import React from "react";
import "./"
// Import Font Awesome icons if not already imported
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebook,
  faPinterest,
  faYoutube,
  faInstagram,
} from "@fortawesome/free-brands-svg-icons";

export default function Footer1() {
  return (
    <section id="footer">
      <div className="logo-end">
        <a href="HomePage.html">
          <img src="images1/Logo1.png" className="le" alt="Logo" />
        </a>
      </div>
      <div className="whole">
        <div className="left">
          <p className="p1">More about Recipe Realm</p>
          <p className="p2">
            Find free, easy-to-follow recipes you can cook at home from
            Australia's best brands. From timeless classics to modern trends,
            budget dinners to entertaining delights, save your favourite
            recipes, upload your own creations and create personalised digital
            cookbooks all on myfoodbook.{" "}
            {/* <a href="AboutUs.html" className="af"> */}
              {/* Learn more about us. */}
            {/* </a>{" "} */}
            To start your search, check out some{" "}
            {/* <a href="Breakfast.html" className="af"> */}
              {/* breakfast recipes */}
            {/* </a> */}
            and get cooking!
          </p>
        </div>

        <div className="right">
          <p>Sign up for the latest recipes and news</p>
          <input type="email" placeholder="email address" />
          <button>Subscribe</button>
          <p style={{ marginTop: "20px" }}>Follow Recipe Realm</p>
          <FontAwesomeIcon icon={faFacebook} className="fa-brands" />
          <FontAwesomeIcon icon={faPinterest} className="fa-brands" />
          <FontAwesomeIcon icon={faYoutube} className="fa-brands" />
          <FontAwesomeIcon icon={faInstagram} className="fa-brands" />
        </div>
      </div>
    </section>
  );
}
